from collections import Counter


def find_key_letter_for_group(group):
    frequency_analysis = Counter(group)
    most_common_letter = frequency_analysis.most_common(1)[0][0]
    shift = (ord(most_common_letter) - ord('e')) % 26
    return chr(shift + ord('a'))


ciphertext = ""
key_length = 6


groups = ['' for _ in range(key_length)]
for i, letter in enumerate(ciphertext):
    groups[i % key_length] += letter


key = ''.join(find_key_letter_for_group(group) for group in groups)
print("The key is likely:", key)
